import React from 'react';
import './navbar.css';


import {Link} from 'react-scroll';

const Navbar = () => {
  return (
    <nav className="navbar"> 
      {/* <img src={logo} alt="Logo" className="logo" /> */}
      <div className='desktopMenu'>
        <Link to="intro" className='desktopMenuListItem'>Home</Link>
        <Link to="about" className='desktopMenuListItem'>About</Link>
        <Link to="skills" className='desktopMenuListItem'>Skills</Link>
        <Link to="projects" className='desktopMenuListItem'>Projects</Link>
        <Link to="contact" className='desktopMenuListItem'>Contact</Link>
      </div>

      <a href="#contact">
  <button className='desktopMenuBtn'>
    <img 
      className='desktopMenuImg' 
      width="48" 
      height="48" 
      src="https://img.icons8.com/fluency-systems-filled/48/user.png" 
      alt="user"
    />
    Contact Me
  </button>
</a>

    </nav>
  )
}

export default Navbar;
